script: |
  super -f text -I q4020.spq | sort > q4020.out

inputs:
  - name: q4020.spq
    data: |
      SELECT DISTINCT - 89 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - 12 + + 10 * - col2 * - - 96 * + col1 NOT BETWEEN - 60 AND ( - col0 / - col2 * + 37 * + - col2 + CAST ( NULL AS INTEGER ) );
  - name: tab0

outputs:
  - name: q4020.out
    data: |
